import React from 'react';

import { makeStyles } from '@material-ui/core/styles';
import { Grid, Paper, Typography } from '@material-ui/core';

import Background from './imgs/1x/background.png';

const useStyles = makeStyles(theme => ({
    container: {
        backgroundImage: `url(${Background})`,
        backgroundSize: 'cover',
        height: '65vh',
        display: 'flex',
        justifyContent: 'center',
        alignItems: 'flex-start',
    },
    paper: {
        width: '70%',
        marginTop: 80,
        display: 'flex',
        justifyContent: 'center',
        alignItems: 'center',
        flexWrap: 'wrap',
        backgroundColor: 'rgb(255, 255, 255, 0.1)',
        color: 'white'
    },
}));

const Info =  () => {

    const classes = useStyles();

    return (
        <Grid className={classes.container} item xs={12}>

            <Paper className={classes.paper}>

                <Typography className={classes.terri} variant="h2" align="center">
                    Terri Banner
                </Typography>

                <Typography className={classes.contact} variant="h6" align="center">
                    Phone: 704.577.5028
                </Typography>

                <Typography className={classes.contact} variant="h6" align="center">
                    Email: robogator@aol.com
                </Typography>

            </Paper>

        </Grid>

    );
};

export default Info;
